-- Drop eventually existing tables
DROP TABLE IF EXISTS sales;
DROP TABLE IF EXISTS stores;
DROP TABLE IF EXISTS dates;
DROP TABLE IF EXISTS sets;

-- Drop existing domains

DROP DOMAIN IF EXISTS id;
DROP DOMAIN IF EXISTS rgb;
DROP DOMAIN IF EXISTS type;

-- Create DOMAINS

CREATE DOMAIN id AS char varying(20);

CREATE DOMAIN rgb AS text
  CONSTRAINT rgb_check CHECK ((VALUE ~ '^(\d|[a-f]){6}$'::text));

CREATE DOMAIN type AS char(1)
  CONSTRAINT type_check CHECK ((VALUE = ANY (ARRAY['B'::bpchar, 'M'::bpchar])));

-- Create Tables


CREATE TABLE dates (
  date    int NOT NULL,
  day     int,
  dow     int,
  month   int,
  quarter int,
  year    int
);

-- Fact table sales

CREATE TABLE sales (
  sale  int NOT NULL,
  set   id,
  date  int,
  store int,
  items int,
  price money
);

CREATE TABLE sets (
  set    id NOT NULL,
  name   text,
  cat    int,
  x      real,
  y      real,
  z      real,
  weight real,
  year   int,
  img    text
);


CREATE TABLE stores (
  store   int NOT NULL,
  city    text,
  state   text,
  country text
);

