-- Install Constraints

ALTER TABLE ONLY dates
    ADD CONSTRAINT dates_pkey PRIMARY KEY (date);

ALTER TABLE ONLY sales
    ADD CONSTRAINT sales_pkey PRIMARY KEY (sale);

ALTER TABLE ONLY sets
    ADD CONSTRAINT sets_pkey PRIMARY KEY (set);

ALTER TABLE ONLY stores
    ADD CONSTRAINT stores_pkey PRIMARY KEY (store);

ALTER TABLE ONLY sales
    ADD CONSTRAINT sales_date_fkey FOREIGN KEY (date) REFERENCES dates(date);

ALTER TABLE ONLY sales
    ADD CONSTRAINT sales_set_fkey FOREIGN KEY (set) REFERENCES sets(set);

ALTER TABLE ONLY sales
    ADD CONSTRAINT sales_store_fkey FOREIGN KEY (store) REFERENCES stores(store);
